import React, { useEffect, useState } from "react";
import service from "./service.js";
import "./App.css";

function App() {
  const [todos, setTodos] = useState([]);
  const [newTask, setNewTask] = useState("");
  const [searchId, setSearchId] = useState("");
  const [foundTask, setFoundTask] = useState(null);
  const [editTask, setEditTask] = useState(null);
  const [editName, setEditName] = useState("");

  // טוען את כל המשימות כשנכנסים
  useEffect(() => {
    loadTasks();
  }, []);

  async function loadTasks() {
    const data = await service.getTasks();
    setTodos(data);
  }

  // הוספת משימה חדשה
  async function addTask(e) {
    e.preventDefault();
    if (!newTask.trim()) return;
    await service.addTask(newTask);
    setNewTask("");
    await loadTasks();
  }

  // עדכון משימה (שם וסטטוס)
  async function updateTask(task) {
    await service.updateTask(task.id, task.name, !task.isComplete);
    await loadTasks();
  }

  // מחיקת משימה
  async function deleteTask(id) {
    if (window.confirm("למחוק את המשימה?")) {
      await service.deleteTask(id);
      await loadTasks();
    }
  }

  // שליפה לפי מזהה (ID)
  async function getById() {
    if (!searchId.trim()) return;
    try {
      const task = await service.getTaskById(searchId);
      setFoundTask(task);
    } catch {
      setFoundTask("לא נמצאה משימה עם המזהה הזה");
    }
  }

  // עדכון שם משימה
  async function saveEdit() {
    if (!editName.trim()) return;
    await service.updateTask(editTask.id, editName, editTask.isComplete);
    setEditTask(null);
    setEditName("");
    await loadTasks();
  }

  return (
    <div className="todo-container">
      <h1>✨ רשימת משימות ✨</h1>

      {/* הוספת משימה */}
      <form onSubmit={addTask} className="add-form">
        <input
          type="text"
          placeholder="משימה חדשה..."
          value={newTask}
          onChange={(e) => setNewTask(e.target.value)}
        />
        <button type="submit">➕ הוסף</button>
      </form>

      {/* חיפוש לפי מזהה */}
      <div className="search-section">
        <input
          type="number"
          placeholder="חפש לפי מזהה"
          value={searchId}
          onChange={(e) => setSearchId(e.target.value)}
        />
        <button onClick={getById}>🔍 חפש</button>
      </div>

      {foundTask && (
        <div className="found-task">
          <h3>תוצאה:</h3>
          {typeof foundTask === "string" ? (
            <p>{foundTask}</p>
          ) : (
            <p>
              <b>#{foundTask.id}</b> - {foundTask.name}{" "}
              {foundTask.isComplete ? "✅" : "❌"}
            </p>
          )}
        </div>
      )}

      {/* רשימת כל המשימות */}
      <ul className="todo-list">
  {todos.map((task) => (
    <li key={task.id} className={task.isComplete ? "completed" : ""}>
      <div className="task-row">
        <span
          className="task-name"
          onClick={() => updateTask(task)}
          title="לחיצה תסמן כהושלם / לא הושלם"
        >
          {task.name}
        </span>
        <div className="actions">
          <button onClick={() => updateTask(task)}>✅</button>
          <button onClick={() => deleteTask(task.id)}>🗑️</button>
        </div>
      </div>
    </li>
  ))}
</ul>

    </div>
  );
}

export default App;
